import React, { Component } from 'react';


import Head from 'next/head';

class Types extends Component {

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="info-blocks">
                    
                    <div className="container">
                        <div className="img">
                            <img src="images/img44.png" alt="Image Description" />
                        </div>
                        <div className="textblock">
                            <div className="holder">
                                <h2>Online Patient Booking</h2>
                                <p>You can be in touch with patients around the clock. Two-way communication makes it easy to manage changing schedules, and capturing credit information reduces cancellations.</p>
                                <a href="#" className="more">Learn more</a>
                            </div>
                        </div>
                    </div>
                    
                </div>
            </div>

        );
    }
}

export default Types;
